public static List<CommandOperation> clone(List<CommandOperation> ops) {
  List<CommandOperation> opsCopy = new ArrayList<>(ops.size());
  for (CommandOperation op : ops) opsCopy.add(op.getCopy());
  return opsCopy;
}

